import React from 'react'
import { useSelector, useDispatch } from "react-redux";
import { setIMGDATA } from '../redux/actions/IMGDATAaction';

function Game() {
    const { data } = useSelector((state) => state.number); 
    console.log(data)
  return (
    <div>
       {data.map((img, index) => (
  <div key={index}>
    <div>{img.img}</div>
  </div>
))}
    </div>
  )
}

export default Game
